    "Wireless SAW Interrogator and Sensor System Project",nt"tracking_summary":
    {ntt"total": 4,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T21:04:26.991996",nt"name": "wireless-saw-interrogator-and-sensor-system-project",nt"isopen":
    true,nt"url": null,nt"notes": "Wireless, passive, Surface Acoustic Wave
    (SAW), Orthogonal FrequencynCoded (OFC) temperature sensors, operating in a multi-sensornenvironment,
    developed at the University of Central Florida (UCF) havenbeen successfully interrogated
    wirelessly at a distances ranging from 7nto 21 feet with a transceiver system developed
    by Mnemonics, Inc (MNI).nThe proposed innovation adds a coherent detection capability
    to theninterrogator receiver, allowing the phase of the received signal to benmeasured.
     As is done in GPS signal processing, the phase informationnallows precise measurement
    of range (from the interrogator to sensor) asnwell as motion, and if multiple antennas
    are used, angle of arrivaln(i.e. direction) can also be sensed.   The investigation
    will includenoptimizing waveforms for the new measurement capabilities and willnextend
    the detection range well beyond the 21 feet.  Other objectivesnare to develop a
    compact integrated sensor and antenna, synchronizentiming and phase in a multiple
    interrogator network and improve RFnperformance on both the transmit and receive
    side of the interrogator.nThe proposed interrogator is based on a quadrature receiver
    techniquenand will also include wireless backhaul for instantaneous distributionnof
    measurement data. The proposed interrogator and SAW sensors are tonoperate at the
    915 MHz frequency band.  The proposed system will be usednin a broad range of NASA,
    as well as commercial applications.",nt"license_title": "U.S. Government Work",nt"extras":
